<!DOCTYPE html>
<html>
<head>
  <meta name="google" content="notranslate">
  <title></title>
  <link rel="stylesheet" type="text/css" href="styles/panel.css">
  <link rel="stylesheet" type="text/css" href="styles/app_all.css">
  <script src="scripts/openwindow.js"></script>
</head>
<body>
  <div id="uv_titlebar">
    <div id="uv_close">x</div>
    <div id="uv_minimize">_</div>
    <div id="uv_pin">
      <div id="uv_pin_icon"></div>
    </div>
  </div>
  <div id="id_hangouts"></div>
  <div id="id_osx_warning" class="osx_warning"></div>
  <div id="id_application_status" class="application_status">
    <div id="id_application_indicator_panel"
         class="application_indicator_panel"></div>
    <div class="application_status_container">
      <div class="application_status_root">
        <div id="id_application_status_indicator"
             class="application_status_indicator">
          <div id="id_application_status_indicator_loading"
               class="application_status_indicator_loading">
            <div class="loading_icon"></div>
          </div>
          <div id="id_application_status_indicator_notsignin"
               class="application_status_indicator_notsignin">
            <div class="problem_icon"></div>
          </div>
          <div id="id_application_status_indicator_error"
               class="application_status_indicator_error">
            <div class="error_icon"></div>
          </div>
          <div id="id_application_status_indicator_outdated"
               class="application_status_indicator_outdated">
            <div class="outdated_icon"></div>
          </div>
          <div id="id_application_close" class="application_close button_badge">
            <div class="close_icon"></div>
          </div>
          <div id="id_drag_region" class="drag_region button_badge">
            <div class="drag_region_icon"></div>
          </div>
          <div class="app_drag_region button_badge">
            <div class="drag_region_icon"></div>
          </div>
        </div>
        <div id="id_application_status_details"
             class="application_status_details">
          <div id="id_application_status_details_notloaded"
               class="dialog_container status_container
                      application_status_details_notloaded">
            <div id="id_application_status_details_notloaded_title"
                 class="application_status_details_notloaded_title">
            </div>
            <div id="id_application_status_details_notloaded_detail"
                 class="application_status_details_notloaded_detail">
            </div>
            <div class="application_status_retry_button_container">
              <div id="id_application_status_retry_button"
                   class="application_status_retry_button">
                <div id="id_application_status_retry_button_text"
                     class="application_status_retry_button_text">
                </div>
              </div>
            </div>
          </div>
          <div id="id_application_status_details_notsignin"
               class="dialog_container status_container
                      application_status_details_notsignin"></div>
          <div id="id_application_status_details_outdated"
               class="application_status_details_outdated
                      dialog_container status_container">
            <div id="id_application_status_details_outdated_title"
                 class="application_status_details_outdated_title">
            </div>
            <div class="application_status_details_outdated_detail">
              <span id="id_application_status_details_outdated_detail"></span>
              <a id="id_application_learn_more_outdated_message"
                 target="_blank"></a>
            </div>
          </div>
        </div>
      </div>
    </div>
  </div>
  <div id="id_exit_app" class="dialog_container exit_app">
    <div id="id_exit_app_title" class="exit_app_title"></div>
    <div id="id_exit_app_detail" class="exit_app_detail"></div>
    <div class="exit_app_buttons">
      <button id="id_exit_app_buttons_no_button"
              class="exit_app_buttons_no_button"></button>
      <button id="id_exit_app_buttons_quit_button"></button>
      <button id="id_exit_app_buttons_minimize_button"></button>
    </div>
    <div></div>
  </div>
  <div id="id_exit_app_mask" class="exit_app_mask"></div>
  <div id="uv_drag_region" class="uv_drag_region button_badge">
    <div class="drag_region_icon"></div>
  </div>
</body>
</html>
